import React, { Fragment, useState } from 'react';
import { registar_datos } from '../servicios/contactServicio';

const Contact = () => {
  const inputNameTxt = document.getElementById('nameTxt');
  const inputEmailTxt = document.getElementById('emailTxt');
  const inputPhoneNumber = document.getElementById('phoneNumberTxt');
  const inputMessageTxt = document.getElementById('messageTxt');

  // const btnSend = document.getElementById('btnSend');

  const obtenerDatos = () => {
    let name = inputNameTxt.value;
    let email = inputEmailTxt.value;
    let phoneNumber = inputPhoneNumber.value;
    let message = inputMessageTxt.value;

    registar_datos(name, email, phoneNumber, message);
  };
  return (
    <section id='contact'>
      <h2>CONTACT ME</h2>
      <form>
        <div>
          <input
            id='nameTxt'
            type='text'
            placeholder='Name'
            className='border-input'
          />
        </div>
        <div>
          <input
            id='emailTxt'
            type='email'
            placeholder='Email'
            className='border-input'
          />
        </div>
        <div>
          <input
            id='phoneNumberTxt'
            type='tel'
            placeholder='Phone Number'
            className='border-input'
          />
        </div>
        <div>
          <input
            id='messageTxt'
            type='Message'
            placeholder='Message'
            className='border-input'
          />
        </div>
        <div>
          <button id='btnSend' onClick={() => obtenerDatos()}>
            SEND
          </button>
        </div>
      </form>
    </section>
  );
};

export default Contact;
